  return (
    <div>
      <Menu inverted fixed="top" size="massive">
        <Container>
          <Image src="images/naxus12.PNG" size="small" />
          <Menu.Item>
            <Button>Anasayfa</Button>
          </Menu.Item>
          <Menu.Item name="messages" />
          <Menu.Item>
            <Button>Anasayfa</Button>
          </Menu.Item>
          <Menu.Menu position="right">
              <Dropdown item text="Hesabım">
                <Dropdown.Menu>
                  <Dropdown.Item><Button>Kayıt ol</Button></Dropdown.Item>
                  <Dropdown.Item>Automotive</Dropdown.Item>
                  <Dropdown.Item>Home</Dropdown.Item>
                </Dropdown.Menu>
              </Dropdown>
           
          </Menu.Menu>
        </Container>
      </Menu>
    </div>

